DROP TABLE IF EXISTS `b_base_temp`;
CREATE TABLE `b_base_temp` (
  `id` varchar(32) NOT NULL COMMENT '基础模板表主表的id主键',
  `name` varchar(64) DEFAULT NULL COMMENT '模板名称',
  `content` text CHARACTER SET utf8 COLLATE utf8_bin COMMENT '基础模板内容',
  `code` varchar(32) DEFAULT NULL COMMENT '模板代码',
  `description` varchar(256) DEFAULT NULL COMMENT '模板描述',
  `sort` int(3) DEFAULT '0' COMMENT '排序字段，默认0，数字越小排序越靠前',
  `creator` varchar(32) NOT NULL COMMENT '创建者ID',
  `created` datetime NOT NULL COMMENT '创建时间',
  `updator` varchar(32) DEFAULT NULL COMMENT '修改者ID',
  `updated` datetime DEFAULT NULL COMMENT '修改时间',
  `status` int(1) DEFAULT '0' COMMENT '状态,本字段备用',
  `remove_statue` int(1) DEFAULT '0' COMMENT '删除状态，1表示已删除，0表示未删除，默认0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='基础模板表主表';

