DROP TABLE IF EXISTS `b_base_temp_slave`;
CREATE TABLE `b_base_temp_slave` (
  `id` varchar(32) NOT NULL COMMENT '基础模板表子表ID主键',
  `master_id` varchar(32) NOT NULL COMMENT '基础模板表主表ID，外键',
  `quote_id` varchar(32) DEFAULT NULL COMMENT '引用编号，可以是数据字典id或者模板id',
  `type` int(1) DEFAULT NULL COMMENT '引用类型，0表示未引用，1表示引用数据字典，2表示引用模板',
  `value` varchar(512) DEFAULT NULL COMMENT '本条数据的值',
  `code` varchar(32) DEFAULT NULL COMMENT '代码',
  `category` int(1) DEFAULT NULL COMMENT '本条数据的类别，1表示XX,2表示XX',
  `sort` int(3) DEFAULT '0' COMMENT '排序字段，默认0，数字越小排序越靠前',
  `status` int(1) DEFAULT '1' COMMENT '状态，1表示启用，0表示禁用，默认1',
  `remark` varchar(64) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='基本模板从表';

