  `lic_no` varchar(32) DEFAULT NULL COMMENT '许可证号码',
  `retail_code` varchar(32) DEFAULT NULL COMMENT '零售户编号',
  `biz_lic_no` varchar(32) DEFAULT NULL COMMENT '工商营业执照编号',
  `issue_unit` varchar(64) DEFAULT NULL COMMENT '发证单位，如潮州市烟草专卖局',
  `corp_name` varchar(64) DEFAULT NULL COMMENT '企业名称',
  `econ_natu` varchar(16) DEFAULT NULL COMMENT '经济性质，如集体企业、个人独资、有限公司、国有企业等',
  `id_card` varchar(32) DEFAULT NULL COMMENT '证件号码',
  `premises` varchar(128) DEFAULT NULL COMMENT '经营场所，即经营地址',
  `phone` varchar(32) DEFAULT NULL COMMENT '联系电话',
  `biz_scope` varchar(32) DEFAULT NULL COMMENT '经营范围，如卷烟、雪茄烟等',
  `opera_forms` varchar(12) DEFAULT NULL COMMENT '经营业态，如食杂店、便利店等',
  `site_attr` varchar(10) DEFAULT NULL COMMENT '地段属性，如城镇、乡村',
  `spec_type` varchar(32) DEFAULT NULL COMMENT '特群类型，如非特殊群体、其他、下岗失业人员等',
  `lic_status` int(1) DEFAULT '1' COMMENT '许可证状态是否有效，0表示无效，1表示有效，默认1',
  `retail_status` int(1) DEFAULT '1' COMMENT '零售户状态是否有效，0表示无效，1表示有效，默认1',
  `cert_date` datetime DEFAULT NULL COMMENT '发证日期',
  `effe_date` datetime DEFAULT NULL COMMENT '有效日期',
  `biz_lic_date` datetime DEFAULT NULL COMMENT '营业执照有效期',
  `audi_dept` varchar(64) DEFAULT NULL COMMENT '稽查部门',
  `creator` varchar(32) DEFAULT NULL COMMENT '创建者ID',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `updator` varchar(32) DEFAULT NULL COMMENT '修改者ID',
  `updated` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `licunique` (`lic_no`) USING HASH
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='许可证信息表';

