-- ----------------------------
-- Function structure for queryChildrenOrgInfo
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildrenOrgInfo`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `queryChildrenOrgInfo`(orgId VARCHAR(32)) RETURNS varchar(4000) CHARSET utf8
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);

SET sTemp = '$';
SET sTempChd = CAST(orgId AS char);

WHILE sTempChd is not NULL DO
SET sTemp = CONCAT(sTemp,',',sTempChd);
SELECT group_concat(id) INTO sTempChd FROM s_organization where FIND_IN_SET(org_pid,sTempChd)>0;
END WHILE;
return sTemp;
END
;;
DELIMITER ;
