INSERT INTO `b_case_temp_his` VALUES ('124dfeb11f1f475782c72ef46ab2de26', 'b4441e85f66343bf8d7c89e7396050ce', '2', '0', '　　<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span><span contenteditable=\"false\" style=\"color: red;\">${crime_start_time}</span>，我局专卖执法人员<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseAgents}</span>在出示证件、表明身份后，对<span contenteditable=\"false\" style=\"color: red;\">${case_addr}</span>进行检查。<br>　　检查（勘验）情况：检查（勘验）于<span style=\"color: red;\">${crime_start_time}</span>开始，我局专卖执法人员在现场查获涉嫌违法卷烟<span style=\"color: green;\">#{DoCaseCigar}</span>。当事人<span style=\"color: green;\">#{IsSite}</span>无法提供上述卷烟合法有效的来源证明。经调查了解，当事人<span style=\"color: red;\">${per_respon}</span>持有烟草零售许可证，许可证的经营地址为<span style=\"color: red;\">${case_addr}</span>（<span style=\"color: red;\">${corp_name}</span>，许可证号系：<span style=\"color: red;\">${lic_no}</span>）。<br>　　现场检查（勘验）于当天<span style=\"color: red;\">${crime_end_time}</span>结束，经报局领导批准同意，我局执行人员依法对上述涉嫌违法卷烟采取先行登记保存措施（编号：<span style=\"color: red;\">${adv_regi_no}</span>），并将第三联“当事人”联交给<span style=\"color: green;\">#{ToWho}</span>', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:28', '0');
INSERT INTO `b_case_temp_his` VALUES ('206b366357ef45e0bd6392cb98dfe339', 'b4441e85f66343bf8d7c89e7396050ce', '10', '0', '　　<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span><span contenteditable=\"false\" style=\"color: red;\">${crime_start_time}</span>，我局专卖执法人员<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseAgents}</span>在对<span contenteditable=\"false\" style=\"color: red;\">${case_addr}</span>（<span contenteditable=\"false\" style=\"color: red;\">${corp_name}</span>，许可证号系：<span contenteditable=\"false\" style=\"color: red;\">${lic_no}</span>）进行检查时，在其经营场所内查获涉嫌违法卷烟<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseCigar}</span>，当事人<span contenteditable=\"false\" style=\"color: red;\">${per_respon}</span><span contenteditable=\"false\" style=\"color: green;\">#{IsSite}</span>无法提供购进上述卷烟的合法有效证明。经报局领导批准同意后，我局执法人员当场对上述物品予以先行登记保存(<span contenteditable=\"false\">广东省</span>潮州市烟草专卖局先行登记保存证据通知书No.<span contenteditable=\"false\" style=\"color: red;\">${adv_regi_no}</span>）。<p><br></p>', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:44', '0');
INSERT INTO `b_case_temp_his` VALUES ('28c21d66f9454fad8ae7aa78c9896dd2', 'b4441e85f66343bf8d7c89e7396050ce', '8', '0', '　　<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span><span contenteditable=\"false\" style=\"color: red;\">${crime_start_time}</span>，我局专卖执法人员<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseAgents}</span>对市场作例行检查，经出示证件，表明身份，在对<span contenteditable=\"false\" style=\"color: red;\">${case_addr}</span>（<span contenteditable=\"false\" style=\"color: red;\">${corp_name}</span>，许可证号系：<span contenteditable=\"false\" style=\"color: red;\">${lic_no}</span>进行检查时，在其经营场所内查获涉嫌违法卷烟<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseCigar}</span>。当事人<span contenteditable=\"false\" style=\"color: red;\">${per_respon}</span><span contenteditable=\"false\" style=\"color: green;\">#{IsSite}</span>无法提供购进上述卷烟的合法有效证明。当事人的行为涉嫌违反<span contenteditable=\"false\" style=\"color: green;\">#{DoPunishLaw}</span>的规定。经报局领导批准同意后，我局执法人员当场对上述物品予以先行登记保存（广东省潮州市烟草专卖局先行登记保存证据通知书No.<span contenteditable=\"false\" style=\"color: red;\">${adv_regi_no}</span>）。<br>　　我局依法立案后查实，上述涉案卷烟为当事人<span contenteditable=\"false\" style=\"color: red;\">${per_respon}</span>所有，当事人<span contenteditable=\"false\" style=\"color: red;\">${per_respon}</span>已在广东省潮州市烟草专卖局领取烟草专卖零售许可证。上述涉案卷烟是当事人<span contenteditable=\"false\" style=\"color: red;\">${per_respon}</span><span contenteditable=\"false\" style=\"color: red;\">${buy_way}</span>当事人<span contenteditable=\"false\" style=\"color: red;\">${per_respon}</span>无法提供购进涉案卷烟的合法有效证明。<span contenteditable=\"false\" style=\"color: green;\">#{CigarKind}</span>，经检验，<span contenteditable=\"false\" style=\"color: green;\">#{DoCigarAttr}</span>经估价，<span contenteditable=\"false\" style=\"color: green;\">#{DoCigarEval}</span>当事人的上述行为构成了<span contenteditable=\"false\" style=\"color: red;\">${case_cause}</span>的违法行为，当事人对违法事实供认不讳。<br>　　上述事实有涉案卷烟先行登记保存证据通知书、当事人身份证复印件、现场拍摄照片、询问笔录、检查（勘验）笔录、卷烟鉴别检验报告、涉案卷烟估价意见书等证据予以证明。<br>　　当事人的行为违反了<span contenteditable=\"false\" style=\"color: green;\">#{DoLaw}</span>的规定。', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:43', '0');
