an contenteditable=\"false\" style=\"color: red;\">${case_cause}</span>的行为。<br>　　<span contenteditable=\"false\" style=\"color: red;\">${in_inform_date}</span>，我局依法向当事人送达了《广东省潮州市潮州烟草专卖局行政处罚事先告书》（潮烟处告<span contenteditable=\"false\" style=\"color: red;\">${regi_no}</span>），当事人在法定期限内未向我局提出任何陈述、申辩。<br>　　本局认为，当事人<span contenteditable=\"false\" style=\"color: red;\">${case_cause}</span>事实清楚、证据确凿，依据<span contenteditable=\"false\" style=\"color: green;\">#{DoPunishLaw}</span>的规定，拟作出如下行政处罚：<span contenteditable=\"false\" style=\"color: green;\">#{DoPunish}</span><span contenteditable=\"false\" style=\"color: green;\">#{IsSiCigar}</span>', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:33', '0');
INSERT INTO `b_case_temp_his` VALUES ('51656d31a93d43ada025009a80dd05de', 'b4441e85f66343bf8d7c89e7396050ce', '6', '0', '　　经查，你于<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span>因<span contenteditable=\"false\" style=\"color: red;\">${case_cause}</span>的行为，违反了<span contenteditable=\"false\" style=\"color: green;\">#{DoLaw}</span>的规定，依据<span contenteditable=\"false\" style=\"color: green;\">#{DoPunishLaw}</span>的有关规定，我局拟对你作出行政处罚如下：<span contenteditable=\"false\" style=\"color: green;\">#{DoPunish}</span>　　根据《中华人民共和国行政处罚法》第三十一条、第三十二条的规定，你享有陈述权和申辩权。请书写你的陈述和申辩意见，并签署名字和日期。<br>　　当事人：____________________________________', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:33', '0');
INSERT INTO `b_case_temp_his` VALUES ('54dbf2bf0bdd4ebc966bcea010952539', 'b4441e85f66343bf8d7c89e7396050ce', '3', '1', '　　根据《烟草专卖行政处罚程序规定》第二十九条的规定，我局于<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span>对你<span contenteditable=\"false\" style=\"color: red;\">${case_cause}</span>一案（<span contenteditable=\"false\" style=\"color: red;\">${regi_no}</span>）中的涉案卷烟依法进行了抽样并送广东质量监督检验站进行真伪鉴定，鉴定结论是：<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseCigar}</span><p>　　现根据相关法律法规的规定向你告知并送达，如你对本鉴定结论有异议的，可以在十五日内提出重新鉴定申请。</p>', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:34', '0');
