INSERT INTO `b_case_temp_his` VALUES ('8296fefff03e427abad8f106d1540a30', 'b4441e85f66343bf8d7c89e7396050ce', '3', '0', '　　根据《烟草专卖行政处罚程序规定》第二十九条的规定，我局于<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span>对你<span contenteditable=\"false\" style=\"color: red;\">${case_cause}</span>一案（<span contenteditable=\"false\" style=\"color: red;\">${regi_no}</span>）中的涉案卷烟依法进行了抽样并送广东质量监督检验站进行真伪鉴定，鉴定结论是：<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseCigar}</span><p>　　现根据相关法律法规的规定向你告知并送达，如你对本鉴定结论有异议的，可以在十五日内提出重新鉴定申请。</p>', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:29', '0');
