INSERT INTO `b_case_temp_his` VALUES ('ec298a22e13f4e9e837c77b905225f2f', 'b4441e85f66343bf8d7c89e7396050ce', '6', '1', '　　经查，你于<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span>因<span contenteditable=\"false\" style=\"color: red;\">${case_cause}</span>的行为，违反了<span contenteditable=\"false\" style=\"color: green;\">#{DoLaw}</span>的规定，依据<span contenteditable=\"false\" style=\"color: green;\">#{DoPunishLaw}</span>的有关规定，我局拟对你作出行政处罚如下：<span contenteditable=\"false\" style=\"color: green;\">#{DoPunish}</span>　　根据《中华人民共和国行政处罚法》第三十一条、第三十二条的规定，你享有陈述权和申辩权。请书写你的陈述和申辩意见，并签署名字和日期。<br>　　当事人：____________________________________', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:41', '0');
INSERT INTO `b_case_temp_his` VALUES ('feb08ae61df44b4aa73b97ad09084054', 'b4441e85f66343bf8d7c89e7396050ce', '2', '1', '　　<span contenteditable=\"false\" style=\"color: red;\">${crime_date}</span><span contenteditable=\"false\" style=\"color: red;\">${crime_start_time}</span>，我局专卖执法人员<span contenteditable=\"false\" style=\"color: green;\">#{DoCaseAgents}</span>在出示证件、表明身份后，对<span contenteditable=\"false\" style=\"color: red;\">${case_addr}</span>进行检查。<br>　　检查（勘验）情况：检查（勘验）于<span style=\"color: red;\">${crime_start_time}</span>开始，我局专卖执法人员在现场查获涉嫌违法卷烟<span style=\"color: green;\">#{DoCaseCigar}</span>。当事人<span style=\"color: green;\">#{IsSite}</span>无法提供上述卷烟合法有效的来源证明。经调查了解，当事人<span style=\"color: red;\">${per_respon}</span>持有烟草零售许可证，许可证的经营地址为<span style=\"color: red;\">${case_addr}</span>（<span style=\"color: red;\">${corp_name}</span>，许可证号系：<span style=\"color: red;\">${lic_no}</span>）。<br>　　现场检查（勘验）于当天<span style=\"color: red;\">${crime_end_time}</span>结束，经报局领导批准同意，我局执行人员依法对上述涉嫌违法卷烟采取先行登记保存措施（编号：<span style=\"color: red;\">${adv_regi_no}</span>），并将第三联“当事人”联交给<span style=\"color: green;\">#{ToWho}</span>', '6dec42b04d0a46b193164247196cc21b', '2017-05-16 11:41:34', '0');
